CREATE DATABASE sac_db;
\c sac_db

CREATE TABLE roles (
	id SERIAL PRIMARY KEY,
	role_name VARCHAR(255) NOT NULL,
	created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);

CREATE TABLE users (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) NOT NULL,
	username VARCHAR(25) NOT NULL UNIQUE,
	password VARCHAR(255) NOT NULL,
	email VARCHAR(255) DEFAULT '',
	profile_pic VARCHAR(255) DEFAULT 'silhouette.jpg',
	role_id integer NOT NULL,
    remember_token VARCHAR(255) DEFAULT '',
	created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT role_id_fk_1
      FOREIGN KEY (role_id) 
      REFERENCES roles(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE permissions (
	id SERIAL PRIMARY KEY,
	permission VARCHAR(255) NOT NULL,
	created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);

CREATE TABLE main_menu (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) NOT NULL,
	url VARCHAR(255) NOT NULL,
	icon VARCHAR(255) NOT NULL DEFAULT '',
	created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);
CREATE TABLE sub_menu (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) NOT NULL,
	menu_id integer NOT NULL,
	url VARCHAR(255) NOT NULL,
	icon VARCHAR(255) NOT NULL DEFAULT '',
	created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT menu_id_fk_1
      FOREIGN KEY (menu_id) 
      REFERENCES main_menu(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE role_permission (
	id SERIAL PRIMARY KEY,
	id_role integer NOT NULL,
	id_permission integer NOT NULL,
	id_menu integer NOT NULL,
	id_submenu integer DEFAULT NULL,
	created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT role_id_fk_2
      FOREIGN KEY (id_role) 
      REFERENCES roles(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT permission_id_fk_1
      FOREIGN KEY (id_permission) 
      REFERENCES permissions(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT menu_id_fk_2
      FOREIGN KEY (id_menu) 
      REFERENCES main_menu(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT submenu_id_fk_1
        FOREIGN KEY (id_submenu) 
        REFERENCES sub_menu(id)
        ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE companies (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) NOT NULL,
	phone VARCHAR(255) NOT NULL DEFAULT '',
	logo VARCHAR(255) NOT NULL DEFAULT 'buildings-silhouette.jpg',
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);

CREATE TABLE groups (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);

CREATE TABLE carriers (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);

CREATE TABLE company_groups (
	id SERIAL PRIMARY KEY,
	company_id integer NOT NULL,
	group_id integer NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT company_id_fk_3
      FOREIGN KEY (company_id)
      REFERENCES companies(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT group_id_fk_3
      FOREIGN KEY (group_id)
      REFERENCES groups(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE carrier_groups (
	id SERIAL PRIMARY KEY,
	carrier_id integer NOT NULL,
	company_group_id integer NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT carrier_id_fk_1
      FOREIGN KEY (carrier_id)
      REFERENCES carriers(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT company_group_id_fk_1
      FOREIGN KEY (company_group_id)
      REFERENCES company_groups(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE employees (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) NOT NULL,
	phone VARCHAR(255) NOT NULL,
	email VARCHAR(255) NOT NULL,
	position VARCHAR(255) NOT NULL,
	enable BOOLEAN NOT NULL DEFAULT TRUE,
	company_id integer NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT company_id_fk_1
      FOREIGN KEY (company_id) 
      REFERENCES companies(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE support_technicians (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);

CREATE TABLE field_technicians (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);

CREATE TABLE vehicles (
	id SERIAL PRIMARY KEY,
	plate VARCHAR(255) NOT NULL,
	company_id integer NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT company_id_fk_2
        FOREIGN KEY (company_id) 
        REFERENCES companies(id)
        ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE devices (
	id SERIAL PRIMARY KEY,
	name VARCHAR(25) NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);

CREATE TABLE ticket_type (
	id SERIAL PRIMARY KEY,
	name VARCHAR(25) NOT NULL,
	created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now())
);

CREATE TABLE tickets (
	id SERIAL PRIMARY KEY,
	title VARCHAR(255) NOT NULL,
	priority integer NOT NULL,
	status BOOLEAN NOT NULL DEFAULT TRUE,
	report VARCHAR(255) NOT NULL,
	solution VARCHAR(255) NOT NULL DEFAULT '',
	reported_by integer NOT NULL,
	time_taken DOUBLE PRECISION NOT NULL,
    attention VARCHAR(255) NOT NULL DEFAULT '',
	id_user integer NOT NULL,
	id_sac integer NOT NULL,
	id_installer integer DEFAULT NULL,
	id_device integer NOT NULL,
	id_tck_type integer NOT NULL,
	id_vehicle integer NOT NULL,
	id_company_group integer NOT NULL,
	id_carrier_group integer NOT NULL,
	created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT employee_id_fk_1
      FOREIGN KEY (reported_by) 
      REFERENCES employees(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT user_id_fk_1
      FOREIGN KEY (id_user) 
      REFERENCES users(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT support_id_fk_1
      FOREIGN KEY (id_sac) 
      REFERENCES support_technicians(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT installer_id_fk_1
      FOREIGN KEY (id_installer) 
      REFERENCES field_technicians(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT device_id_fk_1
      FOREIGN KEY (id_device) 
      REFERENCES devices(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT type_id_fk_1
      FOREIGN KEY (id_tck_type) 
      REFERENCES ticket_type(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT id_vehicle_fk_1
      FOREIGN KEY (id_vehicle)
      REFERENCES vehicles(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT id_company_group_fk_1
      FOREIGN KEY (id_company_group)
      REFERENCES company_groups(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT id_carrier_group_fk_1
      FOREIGN KEY (id_carrier_group)
      REFERENCES carrier_groups(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE checklist_items (
    id SERIAL PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    device_id integer NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    unique (name, device_id),
    CONSTRAINT device_id_fk_2
      FOREIGN KEY (device_id)
      REFERENCES devices(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE checklist_ticket (
	id SERIAL PRIMARY KEY,
	checklist_id integer NOT NULL,
	ticket_id integer NOT NULL,
    observation VARCHAR(255),
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT id_ticket_fk_1
      FOREIGN KEY (ticket_id)
      REFERENCES tickets(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT id_checklist_fk_1
      FOREIGN KEY (ticket_id)
      REFERENCES checklist_items(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE services (
    id SERIAL PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    type VARCHAR(255) NOT NULL,
    device_id integer NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    unique (name, device_id, type),
    CONSTRAINT device_id_fk_3
      FOREIGN KEY (device_id)
      REFERENCES devices(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE service_ticket (
	id SERIAL PRIMARY KEY,
	service_id integer NOT NULL,
	ticket_id integer NOT NULL,
    cant integer NOT NULL,
    created_at timestamp DEFAULT date_trunc('minute', now()),
	updated_at timestamp DEFAULT date_trunc('minute', now()),
    CONSTRAINT id_ticket_fk_1
      FOREIGN KEY (ticket_id)
      REFERENCES tickets(id)
      ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT id_service_fk_1
      FOREIGN KEY (service_id)
      REFERENCES services(id)
      ON DELETE CASCADE ON UPDATE CASCADE
);


